import React from "react";

const Home = () => {
  return (
    <div className="home">
      <div className="headerContainer">
        <h1>Bem Vindo ao Register</h1>
        <p>Cadastre sua empresa ou funcionário aqui.</p>

        <button>Cadastrar Empresa </button>
        <button>Cadastrar Funcioanário </button>
        <button></button>
      </div>
    </div>
  );
};

export default Home;
